  false,\n\t\"url\": null,\n\t\"notes\": \"The Monthly Statement of the Public Debt
  (MSPD) is available online in summary and full versions, and lists the types of
  Treasury Securities issued to finance the Debt, the related maturity dates, and
  the \"Amount Outstanding\". The downloadable files include the Summary page, the
  STRIPS information, and the Monthly Statement of the Public Debt (MSPD) in its entirety.
  Data is available on the fourth business day of each month. Data on the website
  is available from 1953 to the present. However, for the years 1953-1996 only the
  MSPD in its entirety is available and that is in PDF format.\",\n\t\"license_title\":
